As my cookbook tour comes to an exciting close, I'm gearing up for the grand finale in the heart of San Antonio, Texas, this Sunday, December 3rd, at @felizmodern West Olmos location. If you find yourself in the San Antonio area, I would be absolutely thrilled to meet you!

But wait, the excitement doesn't stop with me – my amiga, Jessica @mycurlyadventures_ will also be there signing her fantastic books. It's a double treat ✍🏼📚

Join us for a fiesta of flavors with delicious cocktails and drinks as we celebrate “Muy Bueno Fiestas” and the “Texas Travel Guide”!

Whether you're looking to snag a new book or want to bring yours for a personalized signature, just make sure to get yourself there to join in the fun. It's going to be an unforgettable time, and I can't wait to hang out with all of you! ⁣

Please spread the word by sharing this post with your family and friends in San Antonio.

Comment “RSVP” and I’ll DM you the link to RSVP and add event to your calendar. 

